c1.documentReady(function () {
    var gauge1 = wijmo.Control.getControl('#wjGauge1');
    var gauge2 = wijmo.Control.getControl('#wjGauge2');
    var gauge3 = wijmo.Control.getControl('#wjGauge3');

    // show Silverlight gauge images
    document.getElementById('slGauge1').src = gaugeImage1;
    document.getElementById('slGauge2').src = gaugeImage2;
    document.getElementById('slGauge3').src = gaugeImage3;

    // toggle tickmarks
    document.getElementById('showTicks').addEventListener('click', function(e) {
        gauge1.showTicks = gauge2.showTicks = gauge3.showTicks = e.target.checked;
    });
  
    // animate the gauges
    var animating = false;
    document.getElementById('animate').addEventListener('click', function(e) {
        animating = e.target.checked;
        if (animating) {
            changeValue();
        }
    });
    function changeValue () {
        gauge1.value = gauge2.value = gauge3.value = Math.random() * 120;
        if (animating) {
            setTimeout(changeValue, 1200);
        }
    }
});

var gaugeImage1 = 'data:image/png;base64,';

var gaugeImage2 = 'data:image/png;base64,';

